import React from "react";
import ReactDOMClient from "react-dom/client";

function TextComponent() {
  return "text";
}

function WrapperComponent(el) {
  return <h1>{el}</h1>;
}

function Main() {
  return <WrapperComponent el={<TextComponent />} />;
}

const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(Main());
